Le trait est définit de la façon suivante. pub trait Future { type Output; fn poll(self: Pin<&mut Self>, cx: &mut Context) -> Poll<Self::Output>;
} Lorsque nous décomposons nous voyons qu'il y a un type associé type Output; qui correspond au type de l'élément retourné par le future. Concernant la méthode, elle retourne Poll<T> un enum , avec un paramètre générique T, pouvant prendre deux formes: pub enum Poll<T> { Ready(T), Pending
} Ainsi, lorsque que la fonction retourne Poll::Ready(10) on dit que le future est terminé car il a produit une valeur. Tandis que lorsque Poll::Pending est renvoyé cela veut dire qu'il n'est pas encore terminé et il doit être reveillé par un évènement qui indique qu'il va peut-être renvoyer Poll::Ready(_). Pour que le future soit reveillé il reçoit une référence (&mut) à un Context, dont il peut recuperer le Waker, structure qui permet de reveiller la tache associé, et le stocke quelque part pour qu'un autre processus puisse le reveiller. PS: Nous ne nous attarderons pas sur Pin<&mut Self> qui assure seulement que le future n'est pas remplacé pendant un appel à poll.

