En général les futures utilisés en rust sont issues de la combinaison de plusieurs futures. Avant novembre 2019 et la sortie de la version 1.39.0 les combinaison étaient effectués avec des structures dites combinatoires. Combinatoire pre 1.39 Composition sequentielle: Ex : f.and_then(|output_future_precedent| nouveau_future(output_future_precedent)) Implication : lorsque future f est executé jusqu'au bout, un nouveau future est construit du resultat du précédent Changement de type: Ex : f.map(|output_future_precedent| nouveau_type(output_future_precedent)) Implication : le type Output du future f est passé dans une fonction lui donnant un nouveau type (modifiant ainsi sa valeur à la fin de l'éxécution). Jointure: Ex : f.join(g) Implication : les futures f et g sont éxécuté parallement et le nouveau future se termine lorsque les deux sont terminés. Selection: Ex : f.select(g) Implication : les futures f et g sont executé parallement et le nouveau future se termine lorsqu'un des deux est terminé. Mise à jour 1.39 Depuis la mise à jour 1.39.0 la syntaxe async/await à été stabilisé permettant d'utiliser les futures comme du code classique. Pour recuperer le resultat d'un future il faut symplement await, ce qui execute le future, dans une fonction asynchrone, qui indique elle meme etre un future (nous reviendrons sur la récupération du résultat d'un future dans la partie suivante). Ex: // Ici le type de retour est implicitement `impl Future<Output = String>`
// Soit une "structure qui est un future avec comme resultat un pointeur de texte"
async fn demo() -> String { // création et attente du resultat du future let future1: u64 = Future1::new().await; assert!(future1 == 10); // création du future sans attendre le resultat let future2 = Future2::new(); // attente du résultat et changement de type + retour implicite de la fonction String::from(future2.await)
} Cette syntaxe rend la combinatoire obselète car on travaille toujours avec les valeurs directement, permettant ainsi de les combiner ou de modifier leur type de manière plus aisé.

