Sur l'exemple si dessus nous avons trouvé un moyen d'attendre le resultat d'un future sans éxécuter la boucle constamment (en parquant le processus). Cependant parfois on souhaite qu'un future soit executé sans se soucier du resultat et ce de manière asynchrone. La plupart des runtime ont une commande pour spawn un future qui sera éxécuté par un ensemble de processus sans bloquer sur une tache en particulier. Souvent les runtimes utilisent un systeme de vol de taches pour maintenir la bonne répartition de ces dernières à travers les differents processus. En étendant sur l'exemple précedent: // Liste des taches
static QUEUE: Vec<Task> = Vec::new(); // pour lancer une tache on l'ajoute à la file
fn spawn<F: Future>(future: F) { // A chaque reveil on ajoute le future à la file d'attente let (task, _) = async_task::spawn(future, |f| QUEUE.push(f), ()); task.schedule()
} fn block_on<F: Future>(future: F) -> F::Output { /* ... */ loop { // On execute les taches reveillés ici for task in QUEUE { task.run() } match future.as_mut().poll(cx) { /* ... */ } }
} fn main() { block_on(async { // stream de connections for connection in Listener::new() { spawn(async { // imprimer le prochain message println!(connection.next().await) }); } })
} De cette manière plusieurs taches peuvent être executés en parallèle sans avoir un processus associé pour chacune.

