Les language de description d'interface permettent de définir des composants de logiciel dans un language neutre de l'implementation de ce dernier. C'est à dire que si un fichier de description est partagé entre un serveur et un client, ils pourront être implémenté dans différents languages de programmation car ils auront la description des éléments pour désérialiser les données. Ex: Le protobuf message Ordre { uint64 qt = 1; double prix = 2;
} devient en rust: pub struct Ordre { qt: u64, prix: f64,
